import React from 'react';
import './navbar.css';

const Navbar = () => {
    return (
        <header>
            <nav className="navbar">
                <div className="logo">Bytebusters</div>
                <ul>
                    <li><a href="#">Energy Analysis</a></li>
                    <li><a href="#">Insights</a></li>
                    <li><a href="#">Cost-saving</a></li>
                </ul>
            </nav>
        </header>
    );
};

export default Navbar;
